using namespace std;

int main() {
	char a,b,c,d,e,f,g,h,i,j,k,l,m,n,o;
	cin >> a >> b >> c >> d >> e >> f >> g >> h >> i >> j >> k >> l >> m >> n >> o;
	cout << k << l << m << n << o << ' ' << f << g << h << i << j << ' ' << a << b << c << d << e;
}

#include <iostream>
using namespace std;

int main() {
	char a[10],b[10],c[10],d[10],e[10];
	char n;
	for (int i = 0; i < 10; ++ i) {
		cin >> a[i] >> b[i] >> c[i] >> d[i] >> e[i];
	} 
	for (int i = 0; i < 10; ++ i) {
		for (int j = 0; j < 10; ++ j) {
			if (a[i] < a[j]) {
				n = a[i];
				a[i] = a[j];
				a[j] = n;
				n = b[i];
				b[i] = b[j];
				b[j] = n;
				n = c[i];
				c[i] = c[j];
				c[j] = n;
				n = d[i];
				d[i] = d[j];
				d[j] = n;
				n = e[i];
				e[i] = e[j];
				e[j] = n;
			}
		} 
	}
	for (int i = 0; i < 10; ++ i) {
		cout << a[i] << b[i] << c[i] << d[i] << e[i] << ' ';
	}
}

#include <cstring>
class School{
public:
    char name[30];
    int age;


    School(){
        strcpy(this->name,"NO_NAME");
        this->age = 0;
    }
    void setName(char name1[]){
        strcpy(this->name , name1);
    }
    void setAge(int year1){
        this->age = year1;
    }
    void operator ++(){
        this->age++;
    }
};

