    Matrix(int rows,int columns){
        int len = rows * columns;
        this->rows = rows;
        this->columns = columns;
        values = new T[len];
        memset(values,'\0',len * sizeof(T));
    }

    Matrix(int rows,int columns,const T value[]){
        this->rows = rows;
        this->columns = columns;
        values = new T[rows * columns];
        for (int i = 0; i < rows* columns; ++i) {
            this->values[i] = value[i];
        }
    }

    Matrix(const Matrix &matrix2){
        this->rows = matrix2.rows;this->columns = matrix2.columns;
        int len = rows * columns;
        values = 0;
        assign0(matrix2);
    }

    ~Matrix()
    {
        delete []values;
    }


    void print(){
        int len = rows * columns;
        for (int i = 0; i < rows; ++i) {
            for (int j = 0; j < columns; ++j) {
                cout<<"    "<<values[i * columns + j];
            }
            cout<<endl;
        }
    }

};

#include <iostream>
#include <string>
#include <vector>
using namespace std;

vector <string> split(const string & line, const string & delimiter = " ") {
	vector <string> words;
	int st = 0;
	while (st < line.size()) {
		int end = line.find(delimiter, st);
		if (end == st) st += delimiter.size();
		else {
			if (end == -1) {
				words.push_back(line.substr(st));
				break;
			}
			words.push_back(line.substr(st, end-st));
			st = end + delimiter.size();
		}
	}
	return words;
}
